import './Popup.module.scss'
import './popup.css'
function Popup( {onclose, classname}) {

    return ( 
        <div className={classname}>
            <button onClick={onclose={}}>CLick</button>
            <h2>Hello</h2>
        </div>
     );
}

export default Popup;
